import React from "react";

import styles from './Header.module.css'
import mealImg from '../../assets/HeaderPic.jpg'
import HeaderCart from "./HeaderCart";
import { Link } from "react-router-dom";

const Header = (props)=> {
    return (

        <>

            <header className={styles.header} >
                <h2>OrdFoo.</h2>

                <ul className={styles['nav-links']}>
                <Link to="/" style={{textDecorationLine:'none'}}> <p>Home</p> </Link>
                <Link to="/menu" style={{textDecorationLine:'none'}}> <p>Menu</p> </Link>
                <Link to="/contact" style={{textDecorationLine:'none'}}> <p>Contact</p> </Link>
                </ul>
              
               <HeaderCart onShow={props.onShow} />
            </header>

            <div className={styles['main-img']} >
               <img src={mealImg}  alt="meal image" /> 
          </div>

        </>
      
    );
}

export default Header;
